import React from "react";
import { Button } from "reactstrap";
import "./style.css";
import img6 from "../images/bear (6).jpg";

const Cart = () => {
  return (
    <div className="container cart">
      <div className="item">
        <img src={img6} alt="" />
        <p className="description">
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Cumque, id
          recusandae. Voluptate similique perferendis possimus ratione! Aliquam,
          soluta, iure tempore fuga distinctio cumque neque ea fugit adipisci
          amet dolorem vero.
        </p>
        <div className="counter">
          <Button color="info">+</Button>
          <p>1</p>
          <Button color="info">-</Button>
        </div>
      </div>
    </div>
  );
};

export default Cart;
